protected fun <T> fromCurrentValue(action: YamlInput.() -> T): T {
    try {
        return action(currentValueDecoder)
    } catch (e: YamlException) {
        if (currentlyReadingValue) {
            throw InvalidPropertyValueException(propertyName, e.message, e.path, e)
        } else {
            throw e
        }
    }
}

